<script setup>
import { computed, ref } from 'vue'
import swooshSound from '@/assets/swoosh.mp3'
const isBouncing = ref(false)

const handleClick = () => {
  bounce()
  playSound()
}

function playSound() {
  const audio = new Audio(swooshSound)
  audio.play().catch((error) => {
    console.error('Audio playback failed:', error)
  })
}

function bounce() {
  if (!isBouncing.value) {
    isBouncing.value = true
    setTimeout(() => {
      isBouncing.value = false
    }, 250) // 애니메이션 지속 시간 (0.3초) 후 클래스 제거
  }
}

const props = defineProps({
  health: {
    type: Number,
    default: 500
  },
  isMain: {
    type: Boolean,
    default: false
  }
})

const originalWidth = 250 // 원래 SVG의 너비
const originalHeight = 250 // 원래 SVG의 높이
const scaleValue = props.isMain ? 1 : 0.5
// 체력에 따라 크기를 계산하는 로직
const size = computed(() => {
  const minSize = 100 // 최소 크기
  const maxSize = 400 // 최대 크기
  const defaultHealth = 500 // 기본 체력
  const calculatedSize = minSize + (props.health / defaultHealth) * (maxSize - minSize)
  return (
    (calculatedSize >= 400 ? 400 : minSize + (props.health / defaultHealth) * (maxSize - minSize)) * scaleValue
  )
})

// 'px' 단위를 포함한 크기 값을 반환
const sizeWithUnit = computed(() => `${size.value}px`)

// viewBox를 동적으로 계산
const viewBox = computed(() => {
  const scaleFactor = size.value / originalWidth
  return `0 0 ${originalWidth * scaleFactor} ${originalHeight * scaleFactor}`
})

// 변환을 위한 transform 값 계산
const transform = computed(() => {
  const scaleFactor = size.value / originalWidth
  return `matrix(${scaleFactor} 0 0 ${scaleFactor} 0 0)`
})


</script>

<style scoped>
.icon-container {
  display: flex;
  justify-content: center;
  align-items: center;
}

/* 클릭 효과 (또잉 효과) */
.is-bouncing {
  animation: bounce 0.3s ease-in-out;
}

@keyframes bounce {
  0% {
    transform: scale(1);
  }
  30% {
    transform: scale(1.05) rotate(5deg);
  }
  50% {
    transform: scale(1.1) rotate(-10deg);
  }
  70% {
    transform: scale(1.05) rotate(5deg);
  }
  100% {
    transform: scale(1) rotate(0deg);
  }
}

/* health size rebalancing */
.health {
  font-size: xx-large;
  position: absolute;
  color: white;
}
</style>
<template>
  <svg
    @click="handleClick"
    :class="{ 'is-bouncing': isBouncing }"
    :width="sizeWithUnit"
    :height="sizeWithUnit"
    :viewBox="viewBox"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlns:xlink="http://www.w3.org/1999/xlink"
  >
    <rect :width="sizeWithUnit" :height="sizeWithUnit" fill="url(#pattern0_692_1729)" />
    <defs>
      <pattern id="pattern0_692_1729" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use
          xlink:href="#image0_692_1729"
          transform="matrix(0.000980484 0 0 0.000976562 -0.00200803 0)"
        />
      </pattern>
      <image
        id="image0_692_1729"
        width="1024"
        height="1024"
        xlink:href="data:image/png;base64,"
      />
    </defs>
  </svg>
  <div class="health">{{ props.health }}</div>
</template>
